import React from 'react';

function MinusIcon(props) {
    return (
        <svg height="512px" id="Layer_1" style="enable-background:new 0 0 512 512;" version="1.1" viewBox="0 0 512 512" width="512px"  xmlns="http://www.w3.org/2000/svg"><rect height="64" width="384" x="64" y="224"/></svg>
    );
}

export default MinusIcon;
